import Header from "../commons/Header/Header";
import Footer from "../commons/Footer/Footer";
import { Card } from "react-bootstrap";
import "./components.css";

function People({ data }) {
  return (
    <>
      <Header />
      <h1 className="pplHeader">Movie characters</h1>
      <div className="pplDiv">
        {data.map((people, i) => {
          return (
            <Card
              className="pplCard"
              style={{
                width: "18rem",
              }}
              key={i}
            >
              <Card.Body>
                <Card.Title>{people.name}</Card.Title>
            <strong><p>{people.height}</p></strong>
            <strong><p>{people.mass}</p></strong>
            <strong><p>{people.hair_color}</p></strong>
            <strong><p>{people.skin_color}</p></strong>
            <strong><p>{people.birth_year}</p></strong>
            <strong><p>{people.height}</p></strong>
              </Card.Body>
            </Card>
          );
        })}

        <Footer />
      </div>
    </>
  );
}

export default People;
